import React, { Component } from 'react'


class Video extends Component{
    render() {
        return(
            <div>
                <video width="320" height="240" autoplay>
                    <source src="Video/video1.mp4" type="video/mp4" />

                </video>
            </div>
        );
    }
}

export default Video;
